import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import MyLayout from './MyLayout';

ReactDOM.render(
    <React.StrictMode>
        <MyLayout />
        <App />
    </React.StrictMode>,
    document.getElementById('root')
);
